import React from "react";

const Resume = () => {
    return(
        <div>
            <h2 id="resume" className="f3 f2-m f1-l fw2 mv3 tc pa4 b">Resume</h2>
            <div>
                <h2 className="tc">The Web Developer BootCamp 2023</h2>
                <p className="tc">HTML, CSS, JavaScript, DOM Manipulation, NodeJS, ExpressJS, MongoDB</p>
                <p className="tc">December 2022</p>
                <a className="" href="https://udemy-certificate.s3.amazonaws.com/pdf/UC-12deb0a3-3247-4700-9dd3-bc057042ba67.pdf">Certificate of completion</a>
            </div>
            <div class="bb bw3 pa4 w5 center near-black"> </div>
        </div>
    );
}

export default Resume;
